INSERT INTO mmdf.market (market_id, applicant_limit, applicant_population, end_date, market_description, market_end, market_fee, image, market_location, market_name, market_start, market_status, start_date) VALUES (1, 30, null, '2024-06-01 00:00:00.000000', '親愛的賣買賣家們，<br><br>我們誠摯邀請您參加我們舉辦的「賣肝工程師活動市集」！這將是一場匯聚了創意、熱情和獨特商品的盛會，讓您展現工程師們的多樣化才華，同時體驗市集的獨特魅力。<br><br>在這個市集上，您將有機會展示和推廣您的產品，讓更多人認識您的創意和工藝。無論您是手工藝品製作、烘焙美食、開發程式或者提供其他創意商品和服務，我們都歡迎您加入我們的行列，與我們一起創造一個充滿活力和歡樂的活動！<br><br>此外，我們還將提供各種精彩的娛樂活動，包括音樂表演、以及有趣的遊戲和抽獎活動。您和您的家人朋友都能在這個活動中找到樂趣和享受。<br><br>您的參與將有助於支持想要當工程師的夢想者，讓他們能看到工程師們展示和推廣創意和產品，並讓當工程師的您持續爆肝。這是一個互相學習、交流和鼓勵的機會，我們誠摯地邀請您加入我們的行列，共同創造一個充滿活力和歡樂的活動！<br><br>如果您有興趣成為我們市集的賣家，請聯繫我們，我們將提供您更多的信息和詳細的參展資訊。<br><br>無論您是參與活動還是成為我們的賣家，我們都期待著與您相聚在「賣肝工程師活動市集」上。謝謝您的支持和參與！<br><br>期待與您相見，<br><br>[Tibame]', '2024-06-08 00:00:00.000000', 1000, , 'Tibame：桃園市中壢市復興路46號9樓', '賣肝工程師市集活動', '2024-06-07 00:00:00.000000', 1, '2024-05-30 00:00:00.000000');
INSERT INTO mmdf.market (market_id, applicant_limit, applicant_population, end_date, market_description, market_end, market_fee, image, market_location, market_name, market_start, market_status, start_date) VALUES (2, 30, null, '2024-06-06 00:00:00.000000', '親愛的賣家們，<br><br>歡迎加入我們即將舉辦的「多元文化市集，百花齊放」活動！這將是一個展示多元文化魅力、豐富商品和互動交流的絕佳機會。<br><br>為什麼參加我們的市集？<br><br>展示您的產品：將您獨特的商品展示給來自各地的參觀者，吸引更多潛在客戶。<br><br>擴大您的市場：透過參加我們的市集，您將有機會接觸到新的客戶群體，擴大您的業務影響力。<br><br>文化交流：在我們的市集中，您將有機會與來自不同文化背景的賣家和參觀者交流，拓展您的視野。<br><br>參與方式：<br><br>如果您有興趣參加我們的市集，請動動您的指頭按下報名按鈕，名額有限先搶先贏。<br><br>注意事項：<br><br>參展賣家名額有限，將以先報名先確認參展資格。報名成功後，我們將提供進一步的參展資訊和準備事項。<br><br>我們期待著您的參與，一同共創一場精彩的多元文化市集！<br><br>[多元主辦方]', '2024-06-09 00:00:00.000000', 1000, , '新北大都會公園：新北市三重區水漾路一段', '多元文化市集，百花齊放', '2024-06-08 00:00:00.000000', 1, '2024-06-01 00:00:00.000000');
